DROP TABLE if exists reservation;
DROP TABLE if exists customers CASCADE;
DROP TABLE if exists property CASCADE;
DROP TABLE if exists host CASCADE;
DROP TABLE if exists date CASCADE;

CREATE TABLE IF NOT EXISTS host(
                email VARCHAR(64) PRIMARY KEY,
                host_name VARCHAR(64),
                account_created INT,
                number_of_listings INT,
                number_of_reviews INT,
                review_scores_rating INT,
                review_scores_cleanliness INT,
                review_scores_accuracy INT,
                review_scores_communication INT,
                review_scores_location INT,
                review_scores_checkin INT,
                review_scores_value INT
            );

CREATE TABLE IF NOT EXISTS customers(
                customer_name VARCHAR(64),
                account_created INT,
                no_of_booking INT,
                total_spending NUMERIC,
                email VARCHAR(64) PRIMARY KEY,
                phone VARCHAR(25),
                gender CHAR(1)
            );



CREATE TABLE IF NOT EXISTS property(
                property_id VARCHAR(16) PRIMARY KEY,
                email VARCHAR(64) REFERENCES host(email),
                property_type VARCHAR(20),
                room_type VARCHAR(20),
                accommodates INT,
                bathrooms INT,
                beds INT,
                bed_type VARCHAR(20),
                country VARCHAR(20),
                city VARCHAR(50)
                );

CREATE TABLE IF NOT EXISTS date(
                id VARCHAR(16) PRIMARY KEY,
                day INT,
                month INT,
                year INT,
                day_of_week VARCHAR(16),
                is_weekend VARCHAR(16));

CREATE TABLE IF NOT EXISTS reservation(
                reservation_id VARCHAR(16) PRIMARY KEY,
                customer_email VARCHAR(64) REFERENCES customers(email),
                host_email VARCHAR(64) REFERENCES host(email),
                date_id VARCHAR(16) REFERENCES date(id),
                property_id VARCHAR(16) REFERENCES property(property_id),
                duration INT,
                price_per_day NUMERIC,
                number_of_guests INT
            );

delete from date;


delete from customers;


delete from host;

delete from property;


delete from reservation;
